import React,{useState} from "react";

export const FullGradde = () =>{
    const [show,setShow] = useState(false);

    if(!show){
        return(
            <section>
                <div class="container grade">
            
                    <h1 class="title" style={{cursor:'pointer'}} onClick={()=>setShow(true)}>Общщая Оценка</h1>
                    <h1>&#8744;</h1>
                </div>
            </section>
        )
    }else{
        return(
            <section>
                <div class="container">
            
                    <h1 class="title" style={{cursor:'pointer'}} onClick={()=>setShow(false)}>Общщая Оценка</h1>
                    <div>
                        Полный подсчет всех пунктов
                    </div>
            
                </div>
            </section>
        )
    }
    
}
